import React from 'react';

function Reggie() 
{
  const handleClick = () => {
    alert('Button was clicked!');
  };

  return (
    <div style={{ padding: '100px' }}>
      <form onSubmit={handleClick}>
        <button type="submit">Submit</button>
      </form>

    </div>
        
    
  );
}

export default Reggie;
